 import Jsontable from "./jsontable";
 import { BrowserRouter as Router,Routes,Route,Link } from "react-router-dom";

function Jsoncurd(){
    return(
        <div>
            <Router>
                <Routes>
                    <Route path="/" element={<Jsontable/>}/>
                </Routes>
            </Router>

        </div>
    )
}
export default Jsoncurd;
